s ease}\n    .panel:active{cursor:grabbing}\n    .panel:hover{transform:translateY(-6px);box-shadow:0 18px 40px rgba(0,0,0,0.6)}\n    .comic-img{width:100%;height:320px;object-fit:cover;border-radius:10px;display:block;box-shadow:inset 0 -40px 80px rgba(0,0,0,0.45)}\n\n    /* speech bubble */\n    .bubble{position:absolute;left:14px;top:12px;background:linear-gradient(180deg,rgba(255,255,255,0.03),rgba(255,255,255,0.01));backdrop-filter:blur(6px);padding:10px 14px;border-radius:18px;border:1px solid rgba(255,255,255,0.04);font-weight:700;font-size:13px;color:#fff}\n    .bubble::after{content:'';position:absolute;left:18px;bottom:-12px;border-width:12px 10px 0 10px;border-style:solid;border-color:rgba(255,255,255,0.03) transparent transparent transparent}\n\n    .meta{display:flex;justify-content:space-between;align-items:center;margin-top:10px}\n    .meta .title{font-weight:800}\n    .meta .index{color:var(--muted);font-size:12px}\n\n    /* modal viewer */\n    .viewer{position:fixed;inset:0;display:none;align-items:center;justify-content:center;background:linear-gradient(180deg,rgba(3,3,7,0.6),rgba(3,3,7,0.9));backdrop-filter:blur(6px);z-index:60}\n    .viewer.open{display:flex}\n    .viewer-inner{max-width:1100px;width:92%;background:linear-gradient(180deg,#0c0c10,#0a0a0d);border-radius:16px;padding:18px;display:flex;gap:18px;align-items:center}\n    .viewer-img{max-height:80vh;width:auto;max-width:78%;border-radius:10px;box-shadow:0 40px 120px rgba(0,0,0,0.7)}\n    .viewer-side{width:32%;display:flex;flex-direction:column;gap:12px}\n    .close{align-self:flex-end;background:transparent;border:none;color:var(--muted);font-weight:700;cursor:pointer}\n    .nav{display:flex;gap:8px}\n    .nav button{padding:8px 12px;border-radius:10px;border:1px solid rgba(255,255,255,0.04);background:transparent;color:var(--muted);cursor:pointer}\n    .caption{background:var(--glass);padding:12px;border-radius:10px;color:var(--muted);font-size:13px;flex:1;overflow:auto}\n\n    footer{padding:18px 28px;color:var(--muted);font-size:13px;text-align:center;border-top:1px solid rgba(255,255,255,0.02)}\n\n    /* small helpers */\n    .badge{background:linear-gradient(90deg,var(--accent),var(--accent2));padding:6px 10px;border-radius:999px;color:#081219;font-weight:800}\n    .actions{display:flex;gap:8px;align-items:center}\n\n    /* responsive tweaks */\n    @media (max-width:720px){.viewer-inner{flex-direction:column}.viewer-img{max-width:100%}.viewer-side{width:100%}}\n  </style>\n</head>\n<body>\n  <header>\n    <div class=\"brand\">\n      <div class=\"logo\">CB</div>\n      <div>\n        <h1>Night Panels — SuperFun Comic Viewer</h1>\n        <p class=\"lead\">Dark mode, draggable panels, and an immersive fullscreen viewer.</p>\n      </div>\n    </div>\n    <div class=\"controls\">\n      <div class=\"badge\">Dynamic</div>\n      <div class=\"actions\">\n        <button id=\"shuffle\" class=\"btn\">Shuffle</button>\n        <button id=\"exportJson\" class=\"btn\">Export JSON</button>\n        <button id=\"toggleOrder\" class=\"btn\">Toggle Grid/List</button>\n      </div>\n    </div>\n  </header>\n\n  <main>\n    <section id=\"grid\" class=\"panel-grid\"></section>\n  </main>\n\n  <div id=\"viewer\" class=\"viewer\" aria-hidden=\"true\">\n    <div class=\"viewer-inner\" role=\"dialog\" aria-modal=\"true\">\n      <div style=\"display:flex;flex-direction:column;align-items:flex-start;gap:10px;width:72%\">\n        <button id=\"closeViewer\" class=\"close\">✕ CLOSE</button>\n        <img id=\"viewerImg\" class=\"viewer-img\" src=\"\" alt=\"comic page\" />\n      </div>\n      <div class=\"viewer-side\">\n        <div class=\"nav\">\n          <button id=\"prev\">◀ Prev</button>\n          <button id=\"next\">Next ▶</button>\n          <button id=\"zoomIn\">Zoom +</button>\n          <button id=\"zoomOut\">Zoom -</button>\n        </div>\n        <div class=\"caption\" id=\"viewerCaption\">Caption</div>\n        <div style=\"display:flex;gap:8px;justify-content:flex-end\">\n          <button id=\"downloadImg\" class=\"btn primary\">Download</button>\n        </div>\n      </div>\n    </div>\n  </div>\n\n  <footer>Tip: Drag panels to reorder. Click any panel to open the fullscreen comic viewer. </footer>\n\n  <script>\n    // === DYNAMIC IMAGE LIST (replace with your aggregated links) ===\n    const images = [\n      \"{{ $json.links[0].link }}\",\n      \"{{ $json.links[1].link }}\",\n      \"{{ $json.links[2].link }}\",\n      \"{{ $json.links[3].link }}\",\n      \"{{ $json.links[4].link }}\"\n    ];\n\n    // Optional captions for each panel (keeps things fun)\n    const captions = [\n      \"Page 1 — The City that Never Sleeps\",\n      \"Page 2 — Neon Rooftop Chase\",\n      \"Page 3 — Secret Doorway\",\n      \"Page 4 — The Reveal\",\n      \"Page 5 — Dawn and Promise\"\n    ];\n\n    const grid = document.getElementById('grid');\n\n    // create panels\n    function render() {\n      grid.innerHTML = '';\n      images.forEach((src, i) => {\n        const panel = document.createElement('article');\n        panel.className = 'panel';\n        panel.draggable = true;\n        panel.dataset.index = i;\n\n        panel.innerHTML = `\n          <div class=\"bubble\">PAGE ${i+1}</div>\n          <img class=\"comic-img\" src=\"${src}\" alt=\"comic ${i+1}\" />\n          <div class=\"meta\">\n            <div class=\"title\">Scene ${i+1}</div>\n            <div class=\"index\">${i+1} / ${images.length}</div>\n          </div>\n        `;\n\n        // open viewer on click\n        panel.addEventListener('click', (e)=>{\n          if(e.target.tagName.toLowerCase()==='button') return;\n          openViewer(i);\n        });\n\n        // setup drag handlers\n        panel.addEventListener('dragstart', onDragStart);\n        panel.addEventListener('dragover', onDragOver);\n        panel.addEventListener('drop', onDrop);\n        panel.addEventListener('dragend', onDragEnd);\n\n        grid.appendChild(panel);\n      });\n    }\n\n    // Drag & drop reordering\n    let dragSrcIndex = null;\n    function onDragStart(e){\n      dragSrcIndex = +this.dataset.index;\n      this.style.opacity = '0.6';\n      e.dataTransfer.effectAllowed = 'move';\n    }\n    function onDragOver(e){\n      e.preventDefault();\n      e.dataTransfer.dropEffect = 'move';\n    }\n    function onDrop(e){\n      e.stopPropagation();\n      const dst = +this.dataset.index;\n      if(dragSrcIndex===null || dst===dragSrcIndex) return;\n      // reorder array\n      const item = images.splice(dragSrcIndex,1)[0];\n      const cap = captions.splice(dragSrcIndex,1)[0];\n      images.splice(dst,0,item);\n      captions.splice(dst,0,cap);\n      render();\n    }\n    function onDragEnd(){\n      dragSrcIndex = null;\n      Array.from(document.querySelectorAll('.panel')).forEach(p=>p.style.opacity='1');\n    }\n\n    // Viewer\n    const viewer = document.getElementById('viewer');\n    const viewerImg = document.getElementById('viewerImg');\n    const viewerCaption = document.getElementById('viewerCaption');\n    let current = 0, zoom = 1;\n\n    function openViewer(index){\n      current = index;\n      viewer.classList.add('open');\n      viewer.setAttribute('aria-hidden','false');\n      loadViewerImage();\n    }\n    function closeViewer(){\n      viewer.classList.remove('open');\n      viewer.setAttribute('aria-hidden','true');\n      viewerImg.style.transform = 'scale(1)'; zoom = 1;\n    }\n\n    function loadViewerImage(){\n      viewerImg.src = images[current];\n      viewerCaption.textContent = captions[current] || `Page ${current+1}`;\n      viewerImg.onload = ()=> viewerImg.style.opacity = 1;\n    }\n\n    document.getElementById('closeViewer').addEventListener('click', closeViewer);\n    document.getElementById('next').addEventListener('click', ()=>{ current = (current+1)%images.length; loadViewerImage(); });\n    document.getElementById('prev').addEventListener('click', ()=>{ current = (current-1+images.length)%images.length; loadViewerImage(); });\n    document.getElementById('zoomIn').addEventListener('click', ()=>{ zoom = Math.min(3, zoom+0.25); viewerImg.style.transform = `scale(${zoom})`; });\n    document.getElementById('zoomOut').addEventListener('click', ()=>{ zoom = Math.max(0.5, zoom-0.25); viewerImg.style.transform = `scale(${zoom})`; });\n\n    // Keyboard nav\n    window.addEventListener('keydown',(e)=>{\n      if(!viewer.classList.contains('open')) return;\n      if(e.key==='ArrowRight') document.getElementById('next').click();\n      if(e.key==='ArrowLeft') document.getElementById('prev').click();\n      if(e.key==='Escape') closeViewer();\n    });\n\n    // Shuffle\n    document.getElementById('shuffle').addEventListener('click', ()=>{\n      for(let i=images.length-1;i>0;i--){\n        const j = Math.floor(Math.random()*(i+1));\n        [images[i],images[j]] = [images[j],images[i]];\n        [captions[i],captions[j]] = [captions[j],captions[i]];\n      }\n      render();\n    });\n\n    // Export JSON\n    document.getElementById('exportJson').addEventListener('click', ()=>{\n      const data = images.map((src,i)=>({src,caption:captions[i]||null}));\n      const blob = new Blob([JSON.stringify(data,null,2)],{type:'application/json'});\n      const url = URL.createObjectURL(blob);\n      const a = document.createElement('a'); a.href = url; a.download = 'comic_links.json'; a.click();\n      URL.revokeObjectURL(url);\n    });\n\n    // Toggle layout\n    let isGrid = true;\n    document.getElementById('toggleOrder').addEventListener('click', ()=>{\n      isGrid = !isGrid;\n      grid.style.display = isGrid ? 'grid' : 'block';\n      Array.from(document.querySelectorAll('.panel')).forEach(p=>p.style.marginBottom = isGrid ? '0' : '18px');\n    });\n\n    // Download current image\n    document.getElementById('downloadImg').addEventListener('click', ()=>{\n      const link = document.createElement('a'); link.href = images[current]; link.download = `page-${current+1}.png`; document.body.appendChild(link); link.click(); link.remove();\n    });\n\n    // Init\n    render();\n  </script>\n</body>\n</html>"
